const list = document.getElementById('list');
const q = document.getElementById('q');
const video = document.getElementById('video');
const nowName = document.getElementById('nowName');
const nowWarn = document.getElementById('nowWarn');
let hls;

function render(items) {
  list.innerHTML = '';
  if (!items.length) {
    const p = document.createElement('div');
    p.className = 'tip';
    p.textContent = 'Nenhum canal encontrado.';
    list.appendChild(p);
    return;
  }
  items.forEach((c, idx) => {
    const row = document.createElement('div');
    row.className = 'item';
    const pill = document.createElement('span');
    pill.className = 'pill ' + (c.compatible ? 'ok' : 'no');
    pill.textContent = c.compatible ? 'OK' : c.proto;
    const title = document.createElement('div');
    title.className = 'title';
    title.textContent = c.name || ('Canal ' + (idx+1));
    row.appendChild(pill);
    row.appendChild(title);
    row.addEventListener('click', () => play(c));
    list.appendChild(row);
  });
}

function play(c) {
  nowName.textContent = c.name;
  if (!c.compatible) {
    nowWarn.textContent = 'Este formato pode nÃ£o funcionar no Chrome.';
  } else {
    nowWarn.textContent = '';
  }
  if (hls) { hls.destroy(); hls = null; }
  if (c.url.endsWith('.m3u8') || c.url.includes('.m3u8?')) {
    if (Hls.isSupported()) {
      hls = new Hls();
      hls.loadSource(c.url);
      hls.attachMedia(video);
      video.play().catch(()=>{});
    } else if (video.canPlayType('application/vnd.apple.mpegurl')) {
      video.src = c.url;
      video.play().catch(()=>{});
    } else {
      video.src = c.url;
      video.play().catch(()=>{});
    }
  } else {
    video.src = c.url;
    video.play().catch(()=>{});
  }
}

q.addEventListener('input', () => {
  const term = q.value.toLowerCase();
  render(CHANNELS.filter(c => (c.name||'').toLowerCase().includes(term)));
});

render(CHANNELS);
